import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import Layout from '../components/Layout';
import Card from '../components/Card';
import Table from '../components/Table';

const StudentCourses = () => {
  const { currentUser, userRole, loading } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    if (loading) return;
    
    if (!currentUser || userRole !== 'student') {
      navigate('/student');
      return;
    }
  }, [currentUser, userRole, loading, navigate]);

  if (loading) return <div>Loading...</div>;
  if (!currentUser || userRole !== 'student') return null;

  const courses = [
    { id: 1, name: 'Advanced Web Development', code: 'WEB301', instructor: 'Dr. John Smith', schedule: 'Mon, Wed 09:00', attendance: '85%' },
    { id: 2, name: 'Database Design', code: 'DB201', instructor: 'Prof. Jane Doe', schedule: 'Tue, Thu 10:30', attendance: '90%' },
    { id: 3, name: 'Python Programming', code: 'PROG101', instructor: 'Dr. Michel Brown', schedule: 'Mon, Wed, Fri 14:00', attendance: '88%' },
    { id: 4, name: 'Mobile App Development', code: 'MOB401', instructor: 'Dr. Sarah Johnson', schedule: 'Tue, Thu 11:00', attendance: '75%' },
    { id: 5, name: 'Web Design & UI/UX', code: 'DES201', instructor: 'Prof. Emma Wilson', schedule: 'Wed, Fri 15:30', attendance: '92%' },
    { id: 6, name: 'API Development', code: 'API301', instructor: 'Dr. Alex Kumar', schedule: 'Mon, Thu 13:00', attendance: '87%' },
  ];

  return (
    <Layout role="student">
      <div className="space-y-8">
        <div>
          <h1 className="text-3xl font-bold mb-2">My Courses</h1>
          <p className="text-gray-600">View your enrolled courses and attendance in each</p>
        </div>

        {/* Courses Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
          {courses.map((course) => (
            <Card key={course.id}>
              <div className="space-y-3">
                <div className="flex justify-between items-start">
                  <div>
                    <h3 className="font-bold text-lg text-gray-900">{course.name}</h3>
                    <p className="text-sm text-gray-500">{course.code}</p>
                  </div>
                  <div className="bg-blue-100 text-blue-900 px-3 py-1 rounded-full text-sm font-semibold">
                    {course.attendance}
                  </div>
                </div>
                
                <div className="border-t pt-3 space-y-2">
                  <p className="text-sm flex items-center">
                    <span className="mr-2">üë®‚Äçüè´</span>
                    <span className="text-gray-700">{course.instructor}</span>
                  </p>
                  <p className="text-sm flex items-center">
                    <span className="mr-2">üïê</span>
                    <span className="text-gray-700">{course.schedule}</span>
                  </p>
                </div>
              </div>
            </Card>
          ))}
        </div>

        {/* Course Details Table */}
        <Card title="üìö Course Details">
          <Table
            columns={[
              { key: 'code', label: 'Code' },
              { key: 'name', label: 'Course Name' },
              { key: 'instructor', label: 'Instructor' },
              { key: 'attendance', label: 'Attendance' },
            ]}
            data={courses}
            searchable
            paginated
            itemsPerPage={10}
          />
        </Card>
      </div>
    </Layout>
  );
};

export default StudentCourses;
